    getOption2=(title,xAxis, series)=>{
        return{
            title: {
                text: title
            },
            tooltip: {
                trigger: 'axis'
            },
            legend: {
                data:store.echartsData
            },
            grid: {
                left: '3%',
                right: '4%',
                bottom: '3%',
                containLabel: true
            },
            toolbox: {
                feature: {
                    saveAsImage: {}
                }
            },
            xAxis: {
                type: 'category',
                boundaryGap: false,
                data: xAxis
            },
            yAxis: {
                type: 'value'
            },dataZoom: [{
                show: true,
                start: 10,
                end: 90,
                realtime: true
            }, {
                type: 'slider'
            }],
            series: [{
                data: series,
                type: 'line'
            }]
        }
    };

    onSelect=(value)=> {
        console.log('onSelect', value);
        store.search=[];
    };

    filter=(arr, value)=> {
        return arr.filter(v => Object.values(v).some(v => new RegExp(value + '').test(v))
        )
    }
